import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import background from '../images/background.jpg';
import { Table } from 'reactstrap';

export default class TableTransaction extends React.Component {
	constructor() {
		super();
		this.state = {};
	}

	render() {
		return (
			<div
				style={{
					backgroundImage: `url(${background})`,
					width: '100%',
					height: '100%',
					display: 'flex',
					justifyContent: 'center',
					alignItems: 'center'
				}}
			>
				<Table
					responsive
					style={{
						marginTop: '40px',
						backgroundColor: '#F3F5F7'
					}}
				>
					<thead>
						<tr>
							<th>#</th>
							<th>First Name</th>
							<th>Last Name</th>
							<th>Username</th>
						</tr>
					</thead>
					<tbody>
						<tr>
							<th scope="row">1</th>
							<td>Mark</td>
							<td>Otto</td>
							<td>@mdo</td>
						</tr>
						<tr>
							<th scope="row">2</th>
							<td>Jacob</td>
							<td>Thornton</td>
							<td>@fat</td>
						</tr>
						<tr>
							<th scope="row">3</th>
							<td>Larry</td>
							<td>the Bird</td>
							<td>@twitter</td>
						</tr>
					</tbody>
				</Table>
			</div>
		);
	}
}
